    return (
      <div className = 'App'>

        <input type="text" name = 'title' placeholder = 'title' />
        <input type="text" name = 'author' placeholder = 'author' />

        <button onClick = {this.buttonClickHandler}>OK</button>
      </div>
    );
  }
}

export default App;
